class Solution {
  int incremovableSubarrayCount(List<int> nums) {
    int n = nums.length;
    int count = 0;

    // Function to check if the array is strictly increasing
    bool isStrictlyIncreasing(List<int> arr) {
      for (int i = 0; i < arr.length - 1; i++) {
        if (arr[i] >= arr[i + 1]) {
          return false;
        }
      }
      return true;
    }

    // Iterate over all subarrays
    for (int i = 0; i < n; i++) {
      for (int j = i; j < n; j++) {
        // Create a new list excluding the current subarray
        List<int> newArray = [];
        if (i > 0) newArray.addAll(nums.sublist(0, i));
        if (j + 1 < n) newArray.addAll(nums.sublist(j + 1, n));

        // Check if the new array is strictly increasing
        if (isStrictlyIncreasing(newArray)) {
          count++;
        }
      }
    }

    return count;
  }
}
